import React from "react";

function AboutMe() {
  return (
    <div>
      <div className='img-container'>
        <img src='https://cnnespanol.cnn.com/wp-content/uploads/2019/12/s_64a163f16ecbb099e52f2f8271f73cbbfcfc9034be4d646f7375e4db1ca6f3d7_1573501883482_ap_19001106049831-1.jpg?quality=100&strip=info&w=320&h=240&crop=1' alt='me' />
      </div>
    </div>
  )
}

export default AboutMe;
